$jade          : #33939B;
$blue          : #25335A;
$jadeBackground: #44B4B8;
$gray          : #D7D9DF;
$grayDark      : #9CA2B3;

$red: #EB4745;

.modal-lifechart {
  display         : none;
  position        : fixed;
  padding-top     : 6%;
  padding-left    : 18%;
  padding-right   : 15%;
  left            : 0;
  top             : 0;
  width           : 100%;
  height          : 100%;
  overflow        : auto;
  background-color: rgb(0, 0, 0);
  background-color: rgba(0, 0, 0, 0.4);
  z-index         : 999999;

  &.display {
    display        : flex;
    justify-content: center;
    align-items    : center;
  }


  .hidden {
    display: none;
  }

  .modal-content {
    background-color: #fefefe;
    padding         : 45px;
    border          : 1px solid #888;
    max-width       : 980px;
    width           : 100%;
    border-radius   : 10px;

    .modal-head {
      /*display: inline-grid;
      justify-content: space-between;
      grid-template-columns: 80% 64%; */

      .modal-title {
        .task {
          font-size: 1.0em;
        }

        .last_updated {
          font-size: 0.5em;
        }
      }

      .modal-rank {
        .calendar {
          font-size: 33px;
          margin   : 5px 5px 5px 5px;
        }

        .rank {
          font-size: 20px;
        }

        .date {
          background-color: #FFFFFF;
          border          : 4px solid #1C2548;
          border-radius   : 10px;
          height          : 60px;
          cursor          : pointer;
          width           : 95%;
        }

        .footer-container-calendar {
          display              : grid;
          grid-template-columns: 20% 30% 30%;
          border-top           : none;
          width                : 250px;
        }
      }

    }

    .modal-footer {
      display        : flex;
      justify-content: space-around;

      button {
        //display: flex;
        align-items    : center;
        justify-content: center;
        height         : 50px;
        width          : 20rem;
        border-radius  : 30px;
        text-transform : uppercase;
        background     : $gray;
        color          : white;
        cursor         : default;

        &.active {
          background: $jade;
          cursor    : pointer;
        }
      }

      .modal-lifechart-cancel {
        display        : flex;
        align-items    : center;
        justify-content: center;
        height         : 50px;
        width          : 53em;
        border-radius  : 30px;
        text-transform : uppercase;
        background     : #D7D9DF;
        color          : white;
        cursor         : default;
        padding        : 15px;
      }
    }

    .graphs {
      //width: 70%;
      //border: 1px solid #909090;
      //min-height: 380px;
      min-width    : 880px;
      border-radius: 10px;

      .container-calendar {
        max-width    : 100%;
        border       : 2px solid;
        border-radius: 20px;

        .table-calendar td,
        .table-calendar th {
          border        : none;
          color         : #252f3c;
          padding-bottom: 14px;
          padding-top   : 14px;

          &.selected {
            outline: none;
          }
        }
      }

      .footer-container-calendar {
        border-top: none;
      }
    }
  }

}

