@import "_modal_lifechart.scss";

$sizeResponsive: 1028px !default;

.ramp_lifechart_page {

  &__header {
    display        : flex;
    justify-content: space-between;
    padding        : 10px 0px 10px 0px;
    border-bottom  : 2px solid #bbbbbb;
    margin-bottom  : 20px;

    .options__text {
      display              : grid;
      grid-template-columns: 90% 10%;
      color                : #00b2ed;
      font-size            : 20px;
      padding-top          : 10px;

      .title_option {
        font-weight: bold;
      }

      .icon_img_symp {
        margin-left: 20px;
        cursor     : pointer;
      }

      .icon_img_ass {
        margin-left: 20px;
        cursor     : pointer;
      }

      .icon_img_ov {
        margin-left: 20px;
        cursor     : pointer;
      }
    }

    .button-printer {
      background   : transparent;
      border-radius: 5px;
      border       : 2px solid #aaa;
      color        : #898A8B;
      margin-left  : 0.3em;
      padding      : 5px 10px;
    }
  }

  &__content {
    display       : flex;
    flex-direction: row;
    position: relative;

    @media (max-width: $sizeResponsive) {
      flex-direction: column;
    }

    ul {
      list-style-type: none;
      margin         : 0;

      li {
        padding: 2px;
      }
    }

    a {
      color      : #909090;
      font-size  : 1.2em;
      font-weight: bold;
    }

    .col-left {
      width: 18%;

      a {
        line-height: 2.5em;

        &:hover {
          color: #00b2ed;
        }

        &.active {
          color      : #00b2ed;
          font-weight: bold;
        }
      }

      // border Underline
      li::after {
        content      : " ";
        width        : 85%;
        border-bottom: 2px solid #C2C2C2;
        display      : block;

        @media (max-width: $sizeResponsive) {
          width: 100%;
        }
      }

      li:last-child::after {
        border-bottom: 0px;
      }

      @media (max-width: $sizeResponsive) {
        width     : 100%;
        text-align: center;
      }
    }

    .col-right {
      width       : 22%;
      padding-left: 1em;

      h2 {
        font-size    : 1.5em;
        margin-bottom: 0.7em;
        color        : #707070;
      }

      a {
        line-height: 1.7em;

        &.active {
          color: #44B4B8;
        }
      }

      @media (max-width: $sizeResponsive) {
        width     : 100%;
        text-align: center;
      }
    }

    /* col-right (variation)
     * Page: assessments
     */
    .col-right.assessments {
      h2 {
        font-size    : 1.5em;
        margin-bottom: 0;
      }

      div.container-flex {
        display    : flex;
        align-items: center;
        height     : 90%;

        @media (max-width: $sizeResponsive) {
          display: block;
        }
      }

      li {
        a {
          line-height: 2.5em;
        }

        p {
          margin : 0;
          padding: 0;
          color  : #707070;
        }
      }

      // border Underline
      li::after {
        content      : " ";
        width        : 85%;
        border-bottom: 2px solid #C2C2C2;
        display      : block;

        @media (max-width: $sizeResponsive) {
          width: 100%;
        }
      }

      li:last-child::after {
        border-bottom: 0px;
      }
    }

    /* col-right (variation)
     * Page: overview
     */
    .col-right.overview {
      a {
        color: #00b2ed;
      }

      a.active {
        color: #909090;
      }
    }

  }


  /* ramp_lifechart_page__detail */
  &__detail {
    width        : 70%;
    border       : 2px solid #909090;
    min-height   : 380px;
    border-radius: 10px;

    @media (max-width: $sizeResponsive) {
      width: 100%;
    }

    /*
    #result_score_day {
      background: white;
      border-radius: 20px;
      display: flex;
      flex-direction: column;
    }*/
    /*
    .detail {
      &__description {
        font-size: 14px;
        text-align: justify;
        color: blue;
        margin-bottom: 20px;
      }

      &__start {
        background: #eb4745;
        padding: 14px 15px;
        text-align: center;
        border-radius: 40px;
        width: 100%;
        display: block;
        color: white;
        text-transform: uppercase;
      }
    }*/
    /*
    .chart-stats {
      display: grid;
      grid-template-columns: 1fr 1fr 1fr;

      div {
        color: #25335A;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;

        span:first-child {
          font-size: 20px;
        }

        span:last-child {
          font-size: 11px;
        }
      }
    }*/
  }

  #result_score_day__date {
    font-size      : 14px;
    display        : flex;
    justify-content: center;
    align-items    : center;
    color          : blue;
    border         : 2px solid #aaa;
    border-radius  : 5px;

    span {
      margin-right: 10px;
      color       : #165a6b;
    }

    input {
      width     : 242px;
      background: #f6f6f6;
      border    : #f6f6f6;
    }
  }


  /*
   *
   * Custom date-picker style
   *
  */
  .picker__button--close {
    width        : 100%;
    background   : #EB4745;
    color        : white;
    border-radius: 20px;
    border-color : #EB4745;
    margin-bottom: 15px;

    &:hover {
      background  : #EB4745;
      border-color: #EB4745;
      color       : white;
    }
  }

  .picker__button--today {
    display: none;
  }

  .picker__button--clear {
    display: none;
  }

  .picker__button--close:before {
    content: "";
  }

  .picker__box {
    background: #25335A;
    color     : white;
  }

  .picker__day--today:before {
    border-left: 0px;
  }

  .picker__year,
  .picker__month {
    color     : white;
    font-size : 1em;
    font-style: normal;
  }

  .picker__nav--prev {
    border-radius: 30px;
    background   : #C7CCD4;
    margin-left  : 20px;
    padding      : 11px 13px 11px 11px;
  }

  .picker__nav--next {
    border-radius: 30px;
    background   : #C7CCD4;
    margin-right : 20px;
    padding      : 11px 11px 11px 13px;
  }

  .picker__weekday {
    text-transform: uppercase;
  }

  .picker__day--outfocus {
    color: #717684;
  }

  .picker__day {
    font-size: 18px;
  }
}
